import React, {useRef, useState} from "react";

import {
  APIProvider,
  useDirectionService,
  useApiIsLoaded,
  Map,
  AdvancedMarker,
useMapsLibrary,
  Pin,
  InfoWindow,
  AutocompleteProps,
} from "@vis.gl/react-google-maps"



const google = window.google

export default function App() {

